import React, { Component } from 'react'
import './tile.css'
import image from './it-is-i-the-fil.png'

{/* Template */}

    
const Tile = ( data ) => (
  <div className="tile">
    <h3>data.title</h3>
      <h5>Subtitle</h5>
      <h5>Date - Date</h5>
      <img src = { image } className = "projectImage" />
      <p>Short description</p>
  </div>
);

export default Tile;
